informacaoComplementar:
Manutenção Preventiva/Preditiva:
- Inspeção visual de módulos, conexões, quadros elétricos, inversores, estruturas, protetores, etc.;
- Inspeção termográfica em pontos críticos do sistema, incluindo módulos fotovoltaicos via drone;
- Inspeção elétrica BT e MT (medições de correntes, tensões e resistências de isolamento CC e CA, da resistência do aterramento, etc.);
- Reaperto de conexões por parafuso e de terminais de fixação de módulos.
Manutenção/Operação Remota (semanal)
- Acompanhamento e análise de parâmetros de operação da usina disponíveis na nuvem (alarmes, curvas de potência, correntes e tensões CC e CA, resistência de isolamento, CC, etc.);
- Atualização de firmware e parametrização remota.
Plano de Acompanhamento
- Emissão de relatórios de geração e análise de faturas de energia (mensal);
- Acompanhamento do status de operação da usina (diário).
Manutenção Corretiva (Limpeza dos Módulos e Roçagem do Terreno) (até 06 vezes por ano, de acordo com as solicitações da SME)
- Limpeza de todos os módulos voltaicos;
- Capina química de toda a área construída do terreno e no perímetro de seu cercamento (0,3 hectares).

Quantidade: 02 Intérpretes – LIBRAS; 
Dia 18 de setembro das 14h às 22h;
Dia 19 de setembro das 08h30 às 12h30.

